import React from 'react';
import styles from './About.module.scss';

const About = () => {
  const text = "I've been told that data is the most valuable commodity in today's modern world. I - like many others - subscribe to a multitude of online services where I have paid for the convenience and ease of online shopping, gaming, streaming, and more with my privacy. I - like many others, have also never actually read all of the terms and conditions attached to those services. I simply check the checkbox and continue with my merry way. Therefore, in an effort to take back some of my power, I requested access to some of my data that the WWW has collected from me. In this site, I share what I have learned about myself based on the data that services like Spotify, YouTube, Nintendo and others collected about me - a young, Latina, female consumer who plays too much Animal Crossing and finishes eating a meal before she’s able to choose which show to stream.";
  return (
    <div>
      <h1 className={styles['header-default']}>About</h1>
      <p className={styles['text-default']}>{text}</p>
    </div>
  );
};

export default About;
